import React, { useState } from 'react';
import '../TimerCounter/Counter.css';
import Navbar from '../Navbar';
import Footer from '../Footer';

class ContractionTimer extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      hour: 0,
      minute: 0,
      second: 0,
      millisecond: 0
    };
  }

  handleStart = () => {
    console.log('start');
  };

  handleStop = () => {
    console.log('stop');
  };

  handleReset = () => {
    console.log('reset');
  };

    render(){
      return (
        <>
        <Navbar /><br/><br/>
        <Timer /> 
        <Action handleStart={this.handleStart} handleStop={this.handleStart} handleReset={this.handleReset} />                      
        {/* <Footer /> */}
        </>
        );
      }
    }

    const Timer = () => {
      return (
        <div>
          <div>0</div>:
          <div>0</div>:
          <div>0</div>:
          <div>0</div>
        </div>
      );
    };

    const Action = (props) => {
      return (
         <div>
           <button onClick={props.handleReset}>RESET</button>
           <button onClick={props.handleStart}>START</button>
           <button onClick={props.handleStop}>STOP</button>
         </div>
      );
    };




export default ContractionTimer;
